drop sequence publishers_seq;
drop sequence authors_seq;
drop sequence patrons_seq;
drop sequence waits_seq;
drop sequence log_seq;

drop table waits;
drop table loans;
drop table patrons;
drop table copies;
drop table books_authors;
drop table authors;
drop table books;
drop table publishers;
drop table log;
drop table properties;

create table publishers (
  publisher_id    number,
  name            varchar2(100));

create index publishers_pk on publishers(publisher_id);

alter table publishers add constraint publishers_pk primary key (publisher_id) using index publishers_pk;

create sequence publishers_seq start with 1 increment by 1;

create table books (
  isbn            varchar2(10),
  publisher_id    number,
  title           varchar2(200));

create unique index books_pk on books(isbn);
create index books_title_idx on books(title);
create index books_pub_id_fk on books(publisher_id);

alter table books add constraint books_pk primary key (isbn) using index books_pk;
alter table books add constraint fk_publishers_id foreign key (publisher_id) references publishers(publisher_id);

create table authors (
  author_id       number,
  last_name       varchar2(50),
  first_name      varchar2(50));

create unique index authors_pk on authors(author_id);
create index authors_name_fidx on authors(lower(last_name), lower(first_name));

alter table authors add constraint authors_pk primary key (author_id) using index authors_pk;

create sequence authors_seq start with 1 increment by 1;

create table books_authors(
  isbn            varchar2(10),
  author_id       number);

create unique index books_authors_pk on books_authors(isbn, author_id);

alter table books_authors add constraint books_authors_pk primary key (isbn, author_id) using index books_authors_pk;

create table copies (
  isbn            varchar2(10),
  copy_num        number,
  aquired_date    date);

create unique index copies_pk on copies(isbn, copy_num);

alter table copies add constraint copies_pk primary key (isbn, copy_num) using index copies_pk;
alter table copies add constraint fk_books_isbn foreign key (isbn) references books(isbn);

create table patrons (
  card_num        number,
  last_name       varchar2(50),
  first_name      varchar2(50),
  address         varchar2(100),
  postal_code     number(4),
  postal_adress   varchar2(100),
  phone           number(8));
  
create unique index patrons_pk on patrons(card_num);

alter table patrons add constraint patrons_pk primary key (card_num) using index patrons_pk;

create sequence patrons_seq start with 1 increment by 1;

create table loans (
  card_num        number,
  isbn            varchar2(10),
  copy_num        number,
  due_date        date);

create unique index loans_pk on loans(card_num, isbn, copy_num);
create index loans_isbn_idx on loans(isbn, copy_num, due_date);

alter table loans add constraint loans_pk primary key (card_num, isbn, copy_num) using index loans_pk;
alter table loans add constraint fk_loans_copies foreign key (isbn, copy_num) references copies(isbn,copy_num);
alter table loans add constraint fk_loans_patrons foreign key (card_num) references patrons(card_num);

create table waits (
  wait_id         number,
  isbn            varchar2(10),
  card_num        number,
  reg_date        date);

create unique index waits_pk on waits(wait_id);
create index waits__isbn_idx on waits(isbn);
create index waits_cardnum_idx on waits(card_num);

alter table waits add constraint waits_pk primary key (wait_id) using index waits_pk;
alter table waits add constraint fk_waits_books foreign key (isbn) references books(isbn);
alter table waits add constraint fk_waits_patrons foreign key (card_num) references patrons(card_num);

create sequence waits_seq start with 1 increment by 1;

create table log(
  log_id          number,
  card_num        number,
  isbn            varchar2(10),
  copy_num        number,
  log_type        char(1),
  description     varchar2(200),
  time_stamp      timestamp);

create unique index log_pk on log(log_id);
create index log_type_idx on log(log_type, time_stamp);
create index log_cardnum_idx on log(card_num, time_stamp);

alter table log add constraint log_pk primary key (log_id) using index log_pk;

create sequence log_seq start with 1 increment by 1;

create table properties(
  prop_id         number,
  prop_name       varchar2(30),
  prop_value      varchar2(50)
);


